          "id": "66e251ff7f54c7a1cc9be20a3a86b6d2897a6341",
          "message": "chore(deps): update dependency grpcio to v1.78.0 (#1996)\n\nThis PR contains the following updates:\n\n| Package | Change |\n[Age](https://docs.renovatebot.com/merge-confidence/) |\n[Confidence](https://docs.renovatebot.com/merge-confidence/) |\n|---|---|---|---|\n| [grpcio](https://redirect.github.com/grpc/grpc) | `==1.76.0` â†’\n`==1.78.0` |\n![age](https://developer.mend.io/api/mc/badges/age/pypi/grpcio/1.78.0?slim=true)\n|\n![confidence](https://developer.mend.io/api/mc/badges/confidence/pypi/grpcio/1.76.0/1.78.0?slim=true)\n|\n\n---\n\n### Release Notes\n\n<details>\n<summary>grpc/grpc (grpcio)</summary>\n\n###\n[`v1.78.0`](https://redirect.github.com/grpc/grpc/releases/tag/v1.78.0)\n\n[Compare\nSource](https://redirect.github.com/grpc/grpc/compare/v1.76.0...v1.78.0)\n\nThis is release 1.78.0\n([gutsy](https://redirect.github.com/grpc/grpc/blob/master/doc/g_stands_for.md))\nof gRPC Core.\n\nFor gRPC documentation, see [grpc.io](https://grpc.io/). For previous\nreleases, see\n[Releases](https://redirect.github.com/grpc/grpc/releases).\n\nThis release contains refinements, improvements, and bug fixes, with\nhighlights listed below.\n\n## C++\n\n- adding address\\_sorting dep in naming test build.\n([#&#8203;41045](https://redirect.github.com/grpc/grpc/pull/41045))\n\n## Objective-C\n\n- \\[Backport]\\[v1.78.x]\\[Fix]\\[Compiler] Plugins fall back to the\nedition 2023 for older protobuf.\n([#&#8203;41358](https://redirect.github.com/grpc/grpc/pull/41358))\n\n## Python\n\n- \\[python] aio: fix race condition causing `asyncio.run()` to hang\nforever during the shutdown process.\n([#&#8203;40989](https://redirect.github.com/grpc/grpc/pull/40989))\n- \\[Python] Migrate to pyproject.toml build system from setup.py builds.\n([#&#8203;40833](https://redirect.github.com/grpc/grpc/pull/40833))\n- \\[Python] Log error details when ExecuteBatchError occurs (at DEBUG\nlevel).\n([#&#8203;40921](https://redirect.github.com/grpc/grpc/pull/40921))\n- \\[Python] Update setuptools min version to 77.0.1 .\n([#&#8203;40931](https://redirect.github.com/grpc/grpc/pull/40931))\n\n## Ruby\n\n- \\[ruby] Fix version comparison for the ruby\\_abi\\_version symbol for\nruby 4 compatibility.\n([#&#8203;41061](https://redirect.github.com/grpc/grpc/pull/41061))\n\n</details>\n\n---\n\n### Configuration\n\nðŸ“… **Schedule**: Branch creation - \"before 8am on Monday\" (UTC),\nAutomerge - At any time (no schedule defined).\n\nðŸš¦ **Automerge**: Disabled by config. Please merge this manually once you\nare satisfied.\n\nâ™» **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\nðŸ”• **Ignore**: Close this PR and you won't be reminded about this update\nagain.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/open-telemetry/otel-arrow).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0Mi45NS4yIiwidXBkYXRlZEluVmVyIjoiNDIuOTUuMiIsInRhcmdldEJyYW5jaCI6Im1haW4iLCJsYWJlbHMiOlsiZGVwZW5kZW5jaWVzIl19-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>",
