          "message": "chore(deps): update azure-sdk-for-rust monorepo to 0.32.0 (#2043)\n\nThis PR contains the following updates:\n\n| Package | Type | Update | Change |\n|---|---|---|---|\n| [azure_core](https://redirect.github.com/azure/azure-sdk-for-rust) |\nworkspace.dependencies | minor | `0.31.0` â†’ `0.32.0` |\n| [azure_identity](https://redirect.github.com/azure/azure-sdk-for-rust)\n| workspace.dependencies | minor | `0.31.0` â†’ `0.32.0` |\n\n---\n\n### Release Notes\n\n<details>\n<summary>azure/azure-sdk-for-rust (azure_core)</summary>\n\n###\n[`v0.32.0`](https://redirect.github.com/Azure/azure-sdk-for-rust/releases/tag/azure_core%400.32.0)\n\n[Compare\nSource](https://redirect.github.com/azure/azure-sdk-for-rust/compare/azure_core@0.31.0...azure_core@0.32.0)\n\n#### 0.32.0 (2026-02-10)\n\n##### Features Added\n\n- Added `PagerContinuation` for `Pager` continuation.\n- Added `PollerContinuation` for `Poller` continuation.\n\n##### Breaking Changes\n\n- Changed our minimum supported Rust version (MSRV) from 1.85 to 1.88.\n- Changed paging APIs to use `PagerContinuation` and non-generic\n`PagerState`/`PagerResult` types.\n- Changed polling APIs to use `PollerContinuation` and non-generic\n`PollerState`/`PollerResult` types.\n- Renamed `PagerOptions::continuation_token` to `continuation`.\n- Renamed `Pager::continuation_token` to `continuation`.\n- Renamed `Pager::into_continuation_token` to `into_continuation`.\n- Renamed `PageIterator::continuation_token` to `continuation`.\n- Renamed `PageIterator::into_continuation_token` to\n`into_continuation`.\n- `Pager` callbacks must now return `Result`.\n\n</details>\n\n---\n\n### Configuration\n\nðŸ“… **Schedule**: Branch creation - \"before 8am on Monday\" (UTC),\nAutomerge - At any time (no schedule defined).\n\nðŸš¦ **Automerge**: Disabled by config. Please merge this manually once you\nare satisfied.\n\nâ™» **Rebasing**: Whenever PR becomes conflicted, or you tick the\nrebase/retry checkbox.\n\nðŸ”• **Ignore**: Close this PR and you won't be reminded about these\nupdates again.\n\n---\n\n- [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check\nthis box\n\n---\n\nThis PR was generated by [Mend Renovate](https://mend.io/renovate/).\nView the [repository job\nlog](https://developer.mend.io/github/open-telemetry/otel-arrow).\n\n<!--renovate-debug:eyJjcmVhdGVkSW5WZXIiOiI0My44LjUiLCJ1cGRhdGVkSW5WZXIiOiI0My44LjUiLCJ0YXJnZXRCcmFuY2giOiJtYWluIiwibGFiZWxzIjpbImRlcGVuZGVuY2llcyJdfQ==-->\n\nCo-authored-by: renovate[bot] <29139614+renovate[bot]@users.noreply.github.com>\nCo-authored-by: albertlockett <a.lockett@f5.com>",
